  [],\n\t\"title\": \"1:1,000,000-scale estimated outer extent of areas of groundwater
  discharge as evapotranspiration for the Great Basin carbonate and alluvial aquifer
  system of Nevada, Utah, and parts of adjacent states\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 20,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-15T21:07:41.275342\",\n\t\"name\": \"1-1000000-scale-estimated-outer-extent-of-areas-of-groundwater-discharge-as-evapotranspiration-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset was created in support of
  a study focusing on groundwater resources in the Great Basin carbonate and alluvial
  aquifer system (GBCAAS). The GBCAAS is a complex aquifer system comprised of both
  unconsolidated and bedrock formations covering an area of approximately 110,000
  square miles. The aquifer system is situated in the eastern portion of the Great
  Basin Province of the western United States. The eastern Great Basin is experiencing
  rapid population growth and has some of the highest per capita water use in the
  Nation. These factors, combined with the arid setting, have levied intensive demand
  upon current groundwater resources and, thus, predictions of future shortages. Because
  of the large regional extent of the aquifer system, rapid growth in the region,
  and the reliance upon groundwater for urban populations, agriculture, and native
  habitats, the GBCAAS was selected by the U.S. Geological Survey (USGS) Water Resources
  program as part of the National Water Census Initiative to evaluate the Nation's
  groundwater availability. These data represent areas within the GBCAAS study area
  where groundwater discharge may occur as a result of evapotranspiration. The data
  were compiled from previously published groundwater discharge areas in the Great
  Basin.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
